// src/App.js
import React from 'react';
import { ThemeProvider, Box, CssBaseline } from '@mui/material';
import theme from './theme';
import Navbar from './components/Navbar';
import Home from './components/Home';
import News from './components/News';
import People from './components/People';
import Projects from './components/Projects';
import Publications from './components/Publications';
import Software from './components/Software';
import JoinUs from './components/JoinUs';
import backgroundImage from './assets/bg.png'; // Ensure the image is correctly imported

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Box
        sx={{
          minHeight: '100vh',
          background: `url(${backgroundImage}) no-repeat center center fixed`,
          backgroundSize: 'cover',
        }}
      >
        <Navbar />
        <Box id="home" sx={{ scrollMarginTop: '64px', padding: '80px 20px' }}>
          <Home />
        </Box>
        <Box id="news" sx={{ scrollMarginTop: '64px', padding: '80px 20px' }}>
          <News />
        </Box>
        <Box id="people" sx={{ scrollMarginTop: '64px', padding: '80px 20px' }}>
          <People />
        </Box>
        <Box id="projects" sx={{ scrollMarginTop: '64px', padding: '80px 20px' }}>
          <Projects />
        </Box>
        <Box id="publications" sx={{ scrollMarginTop: '64px', padding: '80px 20px' }}>
          <Publications />
        </Box>
        <Box id="software" sx={{ scrollMarginTop: '64px', padding: '80px 20px' }}>
          <Software />
        </Box>
        <Box id="join" sx={{ scrollMarginTop: '64px', padding: '80px 20px' }}>
          <JoinUs />
        </Box>
      </Box>
    </ThemeProvider>
  );
}

export default App;
